import React from "react";
import s from "./style.module.css";

const Layout = (props) => {
  const style = {}

  return (
    <section className={s.root} id={props.id} style={props.urlBg ? {backgroundImage: `url(${props.urlBg})`} : {backgroundColor: `{props.color}`}}>
      <div
        className="wrapper"


      >
        <article>
          <div className={s.title}>
            <h3>{props.title}</h3>
            <span className={s.separator}></span>
          </div>
          <div className={`${s.desc} ${s.full}`}>
            <p>{props.desc}</p>
          </div>
        </article>
      </div>
    </section>
  );
};

export default Layout;
